// src/pages/Home.jsx
import React from 'react';
import TrackTable from '../components/TrackTable';

const Home = () => {
  // Exemple de fausses données
  const dummyTracks = [
    { id: '1', name: 'Song A', year: 2021, acousticness: 0.2, danceability: 0.8, energy: 0.6, instrumentalness: 0.0, liveness: 0.3 },
    { id: '2', name: 'Song B', year: 2020, acousticness: 0.5, danceability: 0.4, energy: 0.9, instrumentalness: 0.1, liveness: 0.1 },
  ];

  return (
    <div>
      <h1>Accueil</h1>
      <TrackTable tracks={dummyTracks} />
    </div>
  );
};

export default Home;
